text:
Beberapa review minor tentang tempat ini menurut saya perlu diluruskan, setidaknya pada saat saya tulis review ini,
dan based on my own preferences tentunya.

1. Pelayanannya bagus kok, cenderung too much malah dari SOP yang digariskan terkait kalimat yang musti diucapkan pramusaji;
2. Orderan juga tidak terlalu lama disajikannya;
3. Makanan dan minuman juga tergolong tasty kok, meskipun beberapa menu tergolong failed di lidah saya
* Baileys coffee macchiato nya enak
* Colenak Beasiswa enak
* Makaroni bola tergolong failed
* Ayam bakar bumbu bali nya enak

Note:
Dine in sekitar jam 6an sore;
suasana tergolong tidak ramai;
dapet sunset view yang tergolong syahdu;
parkiran mobil tergolong sepi.

Okey..
Terima kasih.
@StLaras
